 .abcbiz-wc-qty-button-holder {
   display: flex;
   gap: 10px;
 }

@keyframes abcbizSpin {
   100% {
       transform: rotate(360deg)
   }
}
.abcbiz-wc-qty-button-holder button.abcbiz_cart_loading:after {
   font-family: WooCommerce;
   content: "\e01c";
   vertical-align: top;
