}
#acbbiz-add-to-cart-message .error-message {
   background-color: red;
   color: #fff;
   padding: 10px;
   border-radius: 5px;
   text-align: center;
}
#acbbiz-add-to-cart-message .success-message {
   color: green;
   background-color: #ccffcc;
   padding: 10px;
   border-radius: 5px;
   text-align: center;
}
.woocommerce .abcbiz-wc-qty-button-holder .quantity input {
   width: 90px;
}

