                }
                
                messageDiv.delay(2000).queue(function(next) {
                    $(this).empty();
                    next();
                });
            },
            complete: function() {
                button.removeClass('abcbiz_cart_loading');
            },
            error: function(jqXHR, textStatus, errorThrown) {
