#include <bits/stdc++.h>

using namespace std;

struct node {
    node *ln = 0, *rn = 0;
    int lb, rb;

    int val = 0;

    node() { }
    node(int l, int r) : lb(l), rb(r) {
        if (r - l == 1)
            return;

        int m = (l + r) / 2;
        ln = new node(l, m);
        rn = new node(m, r);
    }

    int get(int l, int r) {
        if (l <= lb && rb <= r)
            return val;
        if (l >= rb || r <= lb)
            return 0;
        return ln->get(l, r) + rn->get(l, r);
    }

    void add(int k) {
        val++;

        if (rb - lb == 1)
            return;

        if (k < (lb + rb) / 2)
            ln->add(k);
        else
            rn->add(k);
    }
};

int main() {
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);

    int n;
    cin >> n;

    vector<int> arr(n);
    for (auto &e : arr)
        cin >> e;

    node st(0, 2 * n);

    vector<int> res(n);
    for (int i = n - 1; i >= 0; i--) {
        int l = arr[i] + st.get(0, arr[i] + 1), r = n + 1;
        while (r - l > 1) {
            int m = (l + r) / 2;

            int x = st.get(0, m + 1);
            if (x >= m + 1 - arr[i]) {
                l = m;
            } else {
                r = m;
            }
        }

        int x = st.get(0, l + 1);
        res[i] = (x >= l + 1 - arr[i] ? r : l);
        st.add(res[i]);
    }

    for (auto e : res)
        cout << e << ' ';

    return 0;
}

