public class GrabbingController : MonoBehaviour
{
    [SerializeField] float grabbingDistance;
    [SerializeField] float grabbingRange;

    [SerializeField] float springForce;
    [SerializeField] float dampingForce;
    [SerializeField] float throwForce;

    Rigidbody grabbedRB;
    RigidbodyInterpolation preInterp;

    void Update()
    {
        if (Input.GetMouseButtonDown(0))
        {
            if (grabbedRB != null)
            {
				//We are already holding an object > ungrab it, yes it should be its own separate method
                grabbedRB.interpolation = preInterp;
                grabbedRB = null;
                return;
            }

            if (Physics.Raycast(transform.position, transform.forward, out RaycastHit hit, grabbingRange) && hit.collider.TryGetComponent(out GrabbableObject grab))
            {
				//We aren't already holding an object that is grabbable, doesn't have to be determined using TryGetComponent > grab it, yes it should also be its own separate method
                grabbedRB = hit.collider.GetComponent<Rigidbody>();
                preInterp = grabbedRB.interpolation;
                grabbedRB.interpolation = RigidbodyInterpolation.Interpolate;
            }
        }
    }

    void FixedUpdate()
    {
        if (!grabbedRB) return;

        Vector3 springForce = CalculateSpringForce();
        Vector3 dampingForce = CalculateDampingForce();

        grabbedRB.AddForce(springForce + dampingForce * 50 * Time.deltaTime);
    }


    Vector3 CalculateSpringForce()
    {
		//Calculates a direction from the grabbed object to where the camera (the object this script is attached to) is looking
        return (transform.position + transform.forward * grabbingDistance - grabbedRB.position) * springForce;
    }

    Vector3 CalculateDampingForce()
    {
        return -grabbedRB.velocity * dampingForce;
    }
}
